           <div className="rounded-circle border Boy Boy2" style={{backgroundColor:props,display:""}}> </div>
           <div className="rounded-circle border Boy Boy3" style={{backgroundColor:props,display:""}}> </div>
           <div className="rounded-circle border Boy Boy4" style={{backgroundColor:props,display:""}}> </div>
        </div>
    </div>
    )
}
export default React.memo(Table_dar)
